var title_f5_57_6033="Tissue Doppler echocardiogram LV";
var content_f5_57_6033=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F58091&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F58091&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Example of tissue Doppler echocardiographic imaging of left ventricle",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 387px; height: 263px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown is an example of low velocity Doppler imaging of myocardial motion, known as tissue Doppler. In this example, velocities of up to 8 cm/sec are color coded according to direction and velocity. As shown in the upper left velocity display, myocardial motion towards the transducer is coded in shades of red and orange (hot colors) and away motion in blue and green (cool colors). The normal short axis precordial image at the top of the screen is shown in mid systole with the anterseptal walls moving away from the transducer and the posteroinferior walls toward. An M-mode tracing details the midseptum and the posterior wall. Note that at peak systole both opposing walls accelerate to at least 8 m/sec and also that there is a gradient of velocity within the myocardium (endocardial layers fastest).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
