" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Pretreatment local staging evaluation for rectal cancer",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?5/57/6041/contributors\">",
"     Authors",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?5/57/6041/contributors\">",
"     Ronald Bleday, MD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?5/57/6041/contributors\">",
"     David Shibata, MD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?5/57/6041/contributors\">",
"     Erik K Paulson, MD",
