" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Diagnosis of acute pulmonary embolism",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
