var title_f5_57_6043="Pediatric anatomic variants C-spine";
var content_f5_57_6043=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F71839&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F71839&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Normal anatomic variants of the cervical spine in children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Lordosis may be absent in normal children up to the age of 15 years and in children in a cervical spine collar.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The posterior arch of C1 fuses by 3 years.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The anterior arch of C1 fuses by 10 years.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The epiphyseal plate at the base of the odontoid fuses with the body of C2 by 6 years, but a fusion line may be evident in normal children up to the age of 10 years.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anterior vertebral wedging due to secondary growth centers may be confused with compression fractures up to the age of 7 years.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Posterior laminar fusion lines may be confused with fractures up to the age of 6 years.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pseudosubluxation of C2 anterior to C3 is seen in approximately 40 percent of children under the age of 8 years.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
