var title_f5_57_6045="Pediatric pneumonia examination";
var content_f5_57_6045=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F65313&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F65313&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Important aspects of the physical examination in a child with suspected pneumonia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Examination feature",
"       </td>",
"       <td class=\"subtitle1\">",
"        Possible significance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         General appearance",
"        </strong>",
"        (state of awareness, cyanosis)*",
"       </td>",
"       <td>",
"        Most children with radiographically confirmed pneumonia appear ill",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        <strong>",
"         Vital signs",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Temperature",
"       </td>",
"       <td>",
"        Fever may be the only sign of pneumonia in highly febrile young children; however, it is variably present and nonspecific",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Respiratory rate",
"       </td>",
"       <td>",
"        <p>",
"         Tachypnea",
"         <sup>",
"          &bull;",
"         </sup>",
"         correlates with radiographically confirmed pneumonia and hypoxemia",
"        </p>",
"        <p>",
"         Absence of tachypnea helps to exclude pneumonia",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Degree of respiratory distress",
"        </strong>",
"       </td>",
"       <td>",
"        Respiratory distress is more specific than fever or cough for lower respiratory infection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Tachypnea",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hypoxemia",
"       </td>",
"       <td>",
"        Predictive of pneumonia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\" colspan=\"2\">",
"        Increased work of breathing:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Retractions",
"       </td>",
"       <td class=\"sublist_other\">",
"        More common in children with pneumonia than without; absence does not exclude pneumonia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Nasal flaring",
"       </td>",
"       <td class=\"sublist_other\">",
"        More common in children with pneumonia than without; absence does not exclude pneumonia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Grunting",
"       </td>",
"       <td class=\"sublist_other\">",
"        Sign of severe disease and pending respiratory failure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Accessory muscle use",
"       </td>",
"       <td class=\"sublist_other\">",
"        Sign of severe disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Head bobbing",
"       </td>",
"       <td class=\"sublist_other\">",
"        Sign of severe disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        <strong>",
"         Lung examination",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cough",
"       </td>",
"       <td>",
"        Nonspecific finding of pneumonia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Auscultation",
"       </td>",
"       <td>",
"        <p>",
"         Findings suggestive of pneumonia include: crackles (rales, crepitations), decreased breath sounds, bronchial breath sounds, egophany, bronchophony, and whispered pectoriloquy",
"        </p>",
"        <p>",
"         Wheezing more common in viral and atypical pneumonias",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Tactile fremitus",
"       </td>",
"       <td>",
"        Suggestive of parenchymal consolidation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Dullness to percussion",
"       </td>",
"       <td>",
"        Suggestive of parenchymal consolidation or pleural effusion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Mental status",
"        </strong>",
"       </td>",
"       <td>",
"        Altered mental status may be a sign of hypoxia",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * For young infants: Ability to attend to the environment, feed, vocalize, and be consoled.",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     World Health Organization definitions of tachypnea according to age are as follows: &lt;2 months: &gt;60 breaths/min; 2 to 12 months: &gt;50 breaths/min; 1 to 5 years: &gt;40 breaths/min; &ge;5 years: &gt;20 breaths/min.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
